import React from 'react'

function List (props) {

    const items = props.items

    const listType = props.type

    const skillStyle = {
        position: "relative",
        float: "left",
        marginLeft: "2rem"
    }

    const projectStyle = {
        listStyleType: "none"
    }

    const projectList = {
        margin: 0,
    }

    return (
        <ul style={listType === "project" && projectList}>
            {items !== undefined && items.map((item, index) => {

                let skillName = "";

                if (props.type === "skill")
                {
                    item = item.split(":");
                    if (item.length === 2) {
                        skillName = item[0] + ":";
                        item = item[1];
                    } else {
                        item = item[0];
                    }
                }

                return (<li key={index} style={listType === 'skill' ? skillStyle : projectStyle}><strong>{skillName}</strong>{item}</li>);
            })}
        </ul>
    );
}

export default List;
